import { Table, TableHead, TableBody, TableRow, TableCell, Container,DeleteIcon } from '@material-ui/core';
import { Delete } from '@material-ui/icons';
import { pink } from '@material-ui/core/colors';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from 'react-router-dom';

const Listings = (props) => {
  const useStyles = makeStyles({
    tableheader: {
      fontSize: "12px", 
      color: "grey", 
      fontWeight: "bold"    
    }
  });

  const classes = useStyles();

  return (
    <Container>
    <Table>
        <TableHead>
            <TableRow>
                <TableCell>Name</TableCell>
                <TableCell>Description</TableCell>
                <TableCell>Hours</TableCell>
                <TableCell>Address</TableCell>
            </TableRow>
        </TableHead>
        <TableBody>
            {props.business.map((item, index)=>(
                <TableRow key={item.id}>
                    <TableCell><Link to={`/listing/${item.id}`}>{item.name}</Link></TableCell>
                    <TableCell>{item.description}</TableCell>
                    <TableCell>{item.hours}</TableCell>
                    <TableCell>{item.address}</TableCell>
                    {status ? 
                        <TableCell>
                            <DeleteIcon onClick={()=> props.removeBusiness(index)} /> 
                        </TableCell> : ""}
                </TableRow>
            ))}
        </TableBody>
    </Table>
</Container>
)}

export default Listings;
